import Experience  from "../sections/Experience";
import Footer from "../components/Footer";
import {BgParticles} from "../components/BgParticles";



function Homepage() {

    console.log(`HOMEPAGE PARTICLESSSS ${particles}`)

    return (
          <div className="app">
            {/* <Particles 
